INSERT INTO `qys` VALUES ('3323','secretario_facultad','servicios_escolares','Mejorar la atencion a los alumnos','Mejorar la atencion','2007-11-13'),('3323','secretario_facultad','biblioteca','Aumentar el numero de volumenes','Es necesario aumentar el numero de libros ','2007-11-13'),('20051101','secretario_facultad','servicios_escolares','Sistemas.uatx.mx solo funciona para Inbternet Explorer 6; el cual esta en desuso(IExplorer7) y afecta a usuarios de otras plataformas (Linux, Mac)','Se podra que funciones para Netscape, Mozilla, Opera y/o Internet Explorer 7; Perdon que recurra a usted, pero no encontre como enviarles la queja a sistemas; si usted me dice yo les paso la queja a ellos; gracias','2008-01-08'),('3701','director','servicios_escolares','Mi estimado director,\r\n\r\nMi cuenta de email de ingenieria.uatx.mx recibe mas del 90% de basura.','Yo no me dedico a dar soluciones a este problema, pero seguramente nuestros colegas en ingenieria en computacion podrian dar sugerencias. Esto es urgente, en otro caso nuestras cuentas de email se volveran impracticas y poco a poco las dejaremos de usar.\r\n\r\nSaludos de su companiero y amigo Heriberto Cuayahuitl.','2006-09-22'),('','director','otro','La Fachada de la Facultad se ve deprimente','Pintar la fachada y arreglar el pavimento donde se estacionan los carros. ','2006-09-25'),('','director','servicios_escolares','La clase de algunos profesores es tediosa y no lleva ninguna secuencia. Incluso a veces ni es parte del temario','Que los profesores preparen sus clases de acuerdo al temario y que lo estudian para que puedan explicarlo','2006-09-25'),('','director','servicios_escolares','Varios profesores de la facultad son muy soberbios.','Que los envien a tomar algun curso de capacitacion sobre relaciones humanas','2006-09-25'),('3323','secretario_facultad','intendencia','Mejorar la Limpieza','Organizar al personal','2008-02-21'),('20021059','secretario_facultad','otro','La pagina esta H O R R I B L E, no puede ser que siendo una escuela de computaciÃ³n, no exista personal para elaborar una pÃ¡gina con mejor diseÃ±o, caray, es una presentaciÃ³n que se esta dando seÃ±ores!','Cambiar el diseÃ±o de la pagina!.','2006-10-07'),('20011996','secretario_facultad','centros_computo','esto es una Prueba','van bien!!!!!!','2007-11-13');
